import React from "react";
import DeviceList from "../components/DeviceList";
import DeviceStatus from "../components/DeviceStatus";
import { css } from "@emotion/react";
import styled from "@emotion/styled";
import { Link } from "react-router-dom";

const ParentContainer = styled.div`
  display: flex;
  justify-content: space-around;
  align-items: flex-start;
  flex-wrap: wrap;
  margin: 2rem;
  border: 3px solid darkblue;
  border-radius: 10px;
  max-width: 70% vw;
  max-height: 70% vh;
`;

const ChildContainer = styled.div`
  display: flex;
  min-width: 15%;
  min-height: 200px;
  margin: 2rem;
  border: 5px solid black;
  border-radius: 10px;
  background-color: #d9dedd;
  align-items: center;
`;

const LinkStyle = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 2rem;
  border: 5px solid black;
  border-radius: 10px;
  background-color: #d9dedd;
  width: 100px;
  height: 35px;
`;

const PageStyle = styled.div`
  display: row-fluid;
  align-items: center;
  border: 5px solid black;
  border-radius: 10px;
  background-color: #d9dedd;
  width: 100%;
  height: 100%;
  justify-content: center;
  text-align: center;

`;

function Dashboard() {
  return (
    <div>
      <LinkStyle>
        <Link to="/">Home Page</Link>
      </LinkStyle>
      <PageStyle>
        <ParentContainer>
          <ChildContainer>
            <DeviceList />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
        </ParentContainer>
        <ParentContainer>
          <ChildContainer>
            <DeviceList />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
          <ChildContainer>
            <DeviceStatus />
          </ChildContainer>
        </ParentContainer>
      </PageStyle>
    </div>
  );
}

export default Dashboard;
